package org.jn.core.java.student.sayed.hassain.datatype;

public class Swapping {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int num1=56, num2=73, a;
		
		System.out.println("Original numbers are "+ num1+ " " +num2);
		//swapping logic
		a=num1;
		num1=num2;
		num2=a;
		System.out.println("Swapped numbers are "+ num1+ " " +num2);
	}

}
